import { useNavigate } from 'react-router-dom';
import React, { useState, useEffect } from 'react';

function HomePage() {
  const navigate = useNavigate();
  const [freelancers, setFreelancers] = useState([]);
  const [pagination, setPagination] = useState({ 
    totalCount: 0,
    pageSize: 10,
    currentPageNumber: 1, 
    totalPages: 1,
    hasPreviousPage: false,
    hasNextPage: false
  });

  async function fetchFreelancers(page = 1) {
    try {
      const response = await fetch(`https://localhost:7202/api/Freelancers/filter?currentPageNumber=${page}&pageSize=${pagination.pageSize}`);
      if (response.ok) {
        const result = await response.json();
        setFreelancers(Array.isArray(result.data) ? result.data : []);
        setPagination({
          totalCount: result.totalCount ?? 0,
          pageSize: result.pageSize ?? 10,
          currentPageNumber: result.currentPageNumber ?? 1,
          totalPages: result.totalPages ?? 1,
          hasPreviousPage: result.hasPreviousPage ?? false,
          hasNextPage: result.hasNextPage ?? false
        });
      }
    } catch (error) {
      console.error('Error fetching freelancers:', error);
    }
  }

  useEffect(() => {
    fetchFreelancers(1);
    // eslint-disable-next-line
  }, []);

  const unarchiveFreelancer = (idx) => {
    setFreelancers(prev =>
      prev.map((f, i) =>
        i === idx ? { ...f, isArchived: false } : f
      )
    );
  };

  const archiveFreelancer = (idx) => {
    setFreelancers(prev =>
      prev.map((f, i) =>
        i === idx ? { ...f, isArchived: true } : f
      )
    );
  };

  return (
    <div className="HomePage">
      <h1>Welcome to Freelancer UI</h1>
      <button onClick={() => navigate('/create')} className="btn btn-primary">Create New Freelancer</button>
      <div className="col-md-12 list">
        <table className="table table-striped table-bordered">
          <thead>
            <tr>
              <th>Username</th>
              <th>Email</th>
              <th>Phone Number</th>
              <th>Skillsets</th>
              <th>Hobbies</th>
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>
            {(Array.isArray(freelancers) ? freelancers : []).map((f, idx) => (
              <tr key={f.id || idx}>
                <td>{f.username || f.Username}</td>
                <td>{f.email || f.Email}</td>
                <td>{f.phoneNum || f.PhoneNum}</td>
                <td>{Array.isArray(f.skillsets) && f.skillsets.length > 0 ? f.skillsets.map(s => s.skillName).join(', ') : '—'}</td>
                <td>{Array.isArray(f.hobbies) && f.hobbies.length > 0 ? f.hobbies.map(h => h.hobbyName).join(', ') : '—'}</td>
                <td>
                  <button className="btn btn-info btn-sm" onClick={() => navigate(`/freelancers/${f.id || idx}`)}>View</button>
                  {f.isArchived ? (
                    <button className="btn btn-success btn-sm" onClick={() => unarchiveFreelancer(idx)}>Unarchive</button>
                  ) : (
                    <button className="btn btn-warning btn-sm" onClick={() => archiveFreelancer(idx)}>Archive</button>
                  )}
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
      <div className="pagination-buttons">
        <button
          className="btn btn-secondary"
          disabled={!pagination.hasPreviousPage}
          onClick={() => fetchFreelancers(pagination.currentPageNumber - 1)}
        >
          Previous
        </button>
        <span> Page {pagination.currentPageNumber} of {pagination.totalPages} </span>
        <button
          className="btn btn-secondary"
          disabled={!pagination.hasNextPage}
          onClick={() => fetchFreelancers(pagination.currentPageNumber + 1)}
        >
          Next
        </button>
      </div>
    </div>
  );
}

export default HomePage;
